import React from "react";
import { withStyles } from "@material-ui/core/styles";

const styles = {
  grid: {
    display: "flex",
    flexDirection: "column",
    justifyItems: "center"
  },
  camera: {
    color: "#d8dcf2",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "30px",
    position: "relative",
    bottom: "60px"
  },
  picture: {
    maxWidth: "100%",
    maxHeight: "100vh",
    margin: "auto",
    marginBottom: 40,
    position: "relative",
    bottom: 80
  }
};

function SpacexList(props) {
  const { classes } = props;

  return (
    <div className={classes.all}>
      <h1 className={classes.header}>
        {props.receivedInfo.flight_number}
        {props.receivedInfo.mission_name}
      </h1>
      <h3 className={classes.camera}>Rocket Name: {props.rocket_name}</h3>
      <h3 className={classes.camera}>Launch Year: {props.launch_year}</h3>
      <div className={classes.grid}>
        <iframe
          title="video"
          className={classes.picture}
          src={props.receivedInfo.video_link}
          allowfullscreen="true"
          width="320"
          height="240"
        />
      </div>
    </div>
  );
}

export default withStyles(styles)(SpacexList);
